// TitleBar.js

import React from "react";

const TitleBar = () => {
  return (
    <div class="bg-blue-500 w-[250px] h-7 text-center text-white text-sm font-medium font-['Cabin'] uppercase leading-normal tracking-tight">
      WELLNEST: MOOD TRACKING FEATURE
    </div>
  );
};

export default TitleBar;
